import React, { Component } from 'react';
import { fetchAllPosts } from '../../services/apihelper';

class PostContainer extends Component {
    constructor(props) {
        super(props);

        this.state = {
            posts: []
        }
    }

    async componentDidMount() {
        const posts = await fetchAllPosts();
        console.log(posts)
        this.setState({
            posts
        })
    }

    render() {
        return (
            <div>
                <p>Posts go Here</p>
            </div>
        )
    }
}

export default PostContainer;
